import {REGISTER} from '../actions/types';
import {combineReducers} from 'redux';



const AddData = (data=[],action)=>{
    switch(action.type){
        case 'DATA':
            return [...data,action.payload]
            default:
                return data
    }
}
export default combineReducers({
    AddData
})
